import './App.css';

function App() {
  return (
   <div className='form'>
    <input  className='email' type='email' name='email' placeholder='Email'></input>
    <input  type='text' name="Name" placeholder='Name'></input>
    <input type='password' name="Pass" placeholder='Password'></input>
    <input type='password' name="confirm " placeholder='confirm password'></input>
    <input type='button' value='validate' placeholder='submit '></input>

   </div>
  );
}

export default App;
